const FIX = (n, p = 4) => (typeof n === "number" ? Number(n).toFixed(p) : n);

function renderTable(id, { title, headers, rows }) {
  const el = document.getElementById(id);
  if (!el) return;
  el.innerHTML = title ? `<h3>${title}</h3>` : "";
  const t = document.createElement("table");
  const th = document.createElement("thead");
  const tb = document.createElement("tbody");
  const hr = document.createElement("tr");
  headers.forEach(h => { const c = document.createElement("th"); c.textContent = h; hr.appendChild(c); });
  th.appendChild(hr);
  rows.forEach(r => {
    const tr = document.createElement("tr");
    r.forEach(v => { const td = document.createElement("td"); td.textContent = typeof v === "number" ? FIX(v) : v; tr.appendChild(td); });
    tb.appendChild(tr);
  });
  t.appendChild(th); t.appendChild(tb); el.appendChild(t);
}

function minMax(a){let mn=Infinity,mx=-Infinity;for(const v of a){if(v<mn)mn=v;if(v>mx)mx=v}return{mn,mx}}
function normalize(a){const{mn,mx}=minMax(a);return mx===mn?a.map(()=>0):a.map(v=>(v-mn)/(mx-mn))}

