function ySumRows(data, coefs){return data.map(r=>({ ...r, ySum: r.y.reduce((a,c,i)=>a+c*(coefs[i]??1),0) }))}
function normalizeRows(rows){
  const xs = rows.map(r=>r.x), ys = rows.map(r=>r.ySum);
  const xn = normalize(xs), yn = normalize(ys);
  return rows.map((r,i)=>({ ...r, xNorm: xn[i], yNorm: yn[i] }));
}

function binning(rows, w){
  const n = Math.ceil(1/w);
  const bins = Array.from({length:n},(_,i)=>({ s:i*w, e:(i+1)*w, vals:[] }));
  for(const r of rows){
    const idx = Math.min(n-1, Math.max(0, Math.floor(r.xNorm/w)));
    bins[idx].vals.push(r.yNorm);
  }
  return bins.map(b=>{
    const c=b.vals.length, avg=c?b.vals.reduce((a,c)=>a+c,0)/c:null;
    return { binStart:b.s, binEnd:b.e, count:c, avgY:avg };
  });
}

let chYNorm=null, ch01=null, ch005=null, chComb=null;
const kill = ch => ch && ch.destroy();

function drawYNorm(rows){
  const ctx = document.getElementById("graficoYNorm").getContext("2d");
  kill(chYNorm);
  const s = [...rows].sort((a,b)=>a.xNorm-b.xNorm);
  chYNorm = new Chart(ctx, {
    type:"line",
    data:{ labels:s.map(r=>FIX(r.xNorm,3)), datasets:[{ label:"Y normalizado vs X normalizado", data:s.map(r=>r.yNorm), fill:false }] },
    options:{ responsive:true, scales:{ x:{ title:{display:true,text:"X normalizado"}}, y:{ min:0, max:1, title:{display:true,text:"Y normalizado"} } } }
  });
}

function drawBins(bins, canvasId, label){
  const ctx = document.getElementById(canvasId).getContext("2d");
  if(canvasId==="graficoBinning01") kill(ch01); else kill(ch005);
  const labels = bins.map(b=>`${FIX(b.binStart,2)}${FIX(b.binEnd,2)}`);
  const data = bins.map(b=>b.avgY===null?null:b.avgY);
  const ch = new Chart(ctx, {
    type:"bar",
    data:{ labels, datasets:[{ label, data }] },
    options:{ responsive:true, scales:{ x:{ title:{display:true,text:"Rangos de X (norm)"}}, y:{ min:0, max:1, title:{display:true,text:"Promedio Y (bin)"} } } }
  });
  if(canvasId==="graficoBinning01") ch01=ch; else ch005=ch;
}

function drawCombined(b01,b005){
  const ctx = document.getElementById("graficoCombinado").getContext("2d");
  kill(chComb);
  const c01 = b01.map(b=>(b.binStart+b.binEnd)/2), c05 = b005.map(b=>(b.binStart+b.binEnd)/2);
  const X = Array.from(new Set([...c01,...c05])).sort((a,b)=>a-b);
  const map = (bins)=>{ const m=new Map(bins.map(b=>[(b.binStart+b.binEnd)/2,b.avgY])); return X.map(x=>m.get(x)??null); };
  chComb = new Chart(ctx, {
    type:"line",
    data:{ labels:X.map(x=>FIX(x,2)), datasets:[ {label:"Binning 0.1", data:map(b01), spanGaps:true}, {label:"Binning 0.05", data:map(b005), spanGaps:true} ] },
    options:{ responsive:true, scales:{ x:{ title:{display:true,text:"Centro del bin (X norm)"}}, y:{ min:0, max:1, title:{display:true,text:"Promedio Y (bin)"} } } }
  });
}

function renderCoef(coefsBase, factor, coefsAp){
  renderTable("tabla-coeficientes", {
    title:"Coeficientes",
    headers:["ndice","Coef Base","Factor","Coef Aplicado"],
    rows: coefsBase.map((c,i)=>[i+1,c,factor,coefsAp[i]])
  });
}
function renderCrudos(rows){
  renderTable("tabla-datos-crudos", {
    title:"Datos crudos y Y Sumatoria",
    headers:["X","Y1","Y2","Y3","Y4","Y5","Y6","Y7","Y Sumatoria"],
    rows: rows.map(r=>[r.x,...r.y,r.ySum])
  });
}
function renderNorm(rows){
  renderTable("tabla-normalizados", {
    title:"Normalizacin (X e Y)",
    headers:["X (orig)","Y Sum (orig)","X norm","Y norm"],
    rows: rows.map(r=>[r.x,r.ySum,r.xNorm,r.yNorm])
  });
}
function renderBins(bins, id, title){
  renderTable(id, {
    title,
    headers:["Bin Inicio","Bin Fin","Cantidad","Prom Y (bin)"],
    rows: bins.map(b=>[b.binStart,b.binEnd,b.count,b.avgY===null?"":b.avgY])
  });
}

document.getElementById("btnCalcular").addEventListener("click", () => {
  const factor = parseFloat(document.getElementById("factor").value || "1");
  if (Number.isNaN(factor)) { alert("Ingrese un nmero vlido para el factor."); return; }

  const coefsAp = COEFICIENTES_BASE.map(c=>c*factor);
  const withSum = ySumRows(DATASET_BASE, coefsAp);
  const norm = normalizeRows(withSum);
  const b01 = binning(norm, 0.1);
  const b005 = binning(norm, 0.05);

  ["tabla-coeficientes","tabla-datos-crudos","tabla-normalizados","tabla-binning-01","tabla-binning-005"].forEach(id=>{ const el=document.getElementById(id); if(el) el.innerHTML=""; });

  renderCoef(COEFICIENTES_BASE, factor, coefsAp);
  renderCrudos(withSum);
  renderNorm(norm);
  renderBins(b01,"tabla-binning-01","Binning (ancho 0.1)");
  renderBins(b005,"tabla-binning-005","Binning (ancho 0.05)");

  drawYNorm(norm);
  drawBins(b01,"graficoBinning01","Promedio Y - bins 0.1");
  drawBins(b005,"graficoBinning005","Promedio Y - bins 0.05");
  drawCombined(b01,b005);
});
